  return (
    <div className="up-next">
      <h3>Up next</h3>
      <ul>
        <li>
          <img src="path/to/upnext-thumbnail1.jpg" alt="The Imaginary" />
          <p>'The Imaginary' Is Coming to Netflix on July 5</p>
          <span>2:03</span>
