        <li>
          <img src="path/to/upnext-thumbnail2.jpg" alt="The Acolyte" />
          <p>"The Acolyte," Star Wars Fan Fiction, and More</p>
          <span>3:21</span>
        </li>
        <li>
          <img src="path/to/upnext-thumbnail3.jpg" alt="Ishana Night Shyamalan" />
          <p>Ishana Night Shyamalan Picks Her Top Miyazaki Films</p>
          <span>1:08</span>
        </li>
      </ul>
    </div>
  );
};

export default UpNext;
